INSERT INTO `products` (`id`, `id_category`, `name`, `picture`, `description`, `price`, `quantity`) VALUES
(1, 1, 'chat siamois', 'http://www.chat-siamois.fr/wp-content/uploads/2016/10/race-chat-siamois-thai-535x533.jpg', 'dfgshgdrhbrgfbhdgfbhdfgbnhdgfbn', 850, 0),
(3, 1, 'chat du Bengal', 'https://static.wixstatic.com/media/8a1965_cb0e0396b3ee4c6b8c0c87dc4bb48d52~mv2_d_2048_1365_s_2.jpg_srz_2048_1365_85_22_0.50_1.20_0.00_jpg_srz', 'Avec le chat de Bengal, vous avez le meilleur des deux mondes : l''apparence majestueuse du leopard et le caractere doux et aimant du chat domestique. Le chat de Bengal est tres affectueux et il ne retient aucune agressivite de ses ancetres. Actif et joueur, il a besoin de compagnie humaine et de beaucoup de distractions.\r\n', 850, 11762),
(4, 1, 'Maine Coon', 'http://www.louisetzeliemartin.org/medias/images/chat-1.jpg', 'Le Maine Coon est originaire des Etats-Unis et c''est la plus ancienne race de chat nord-americaine.', 1200, 11953),
